import React from 'react'; 
import logo from './logo.png'; 

const Logo = () =>{
    return(
        <div style={{width:'100%'}}>
            <img  className='mt0' style={{width:'15rem', height:'auto'}} src={logo}/>
        </div>
    )
}

export default Logo;
